export function _reviewTextStyle(textColor) {
  return {
    fontSize: 14,
    color: textColor
  };
}

export default {
  container: {
    alignItems: "center"
  },
  containerGlue: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center"
  },
  textContainer: {
    fontSize: 12,
    marginLeft: 8,
    color: "#727272"
  }
};
